// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/**
 * @title MultiVault
 * @dev Wallet comunitaria individual con sistema multisig de propuestas y votaciones
 * @notice Cada instancia representa una wallet comunitaria independiente
 */
contract MultiVault {
    // ========== ESTRUCTURAS ==========

    enum ProposalType {
        WITHDRAWAL, // Propuesta de retiro
        ADD_MEMBER // Propuesta de agregar miembro
    }

    enum ProposalStatus {
        PENDING,
        EXECUTED,
        REJECTED
    }

    struct Proposal {
        uint256 id;
        ProposalType proposalType;
        address proposer;
        string description;
        // Para retiros
        address payable recipient;
        uint256 amount;
        // Para agregar miembros
        address newMember;
        // Votación
        uint256 votesFor;
        uint256 votesAgainst;
        mapping(address => bool) hasVoted;
        ProposalStatus status;
        uint256 createdAt;
    }

    // ========== VARIABLES DE ESTADO ==========

    string public name;
    address public factory;
    address[] public members;
    mapping(address => bool) public isMember;
    uint256 public proposalCounter;
    mapping(uint256 => Proposal) public proposals;

    // ========== EVENTOS ==========

    event DepositMade(address indexed depositor, uint256 amount);
    event ProposalCreated(
        uint256 indexed proposalId,
        ProposalType proposalType,
        address proposer
    );
    event VoteCasted(
        uint256 indexed proposalId,
        address indexed voter,
        bool inFavor
    );
    event ProposalExecuted(uint256 indexed proposalId);
    event ProposalRejected(uint256 indexed proposalId);
    event MemberAdded(address indexed newMember);
    event WithdrawalExecuted(address indexed recipient, uint256 amount);

    // ========== MODIFICADORES ==========

    modifier onlyMember() {
        require(isMember[msg.sender], "No eres miembro de este vault");
        _;
    }

    modifier validProposal(uint256 _proposalId) {
        require(
            proposals[_proposalId].status == ProposalStatus.PENDING,
            "Propuesta no esta pendiente"
        );
        _;
    }

    // ========== CONSTRUCTOR ==========

    /**
     * @dev Inicializa el vault con nombre y miembros
     * @param _name Nombre del vault
     * @param _members Array de direcciones de los miembros iniciales
     */
    constructor(string memory _name, address[] memory _members) {
        require(_members.length >= 2, "Se requieren al menos 2 miembros");
        require(bytes(_name).length > 0, "El nombre no puede estar vacio");

        name = _name;
        factory = msg.sender;

        // Agregar miembros
        for (uint256 i = 0; i < _members.length; i++) {
            require(_members[i] != address(0), "Direccion invalida");
            require(!isMember[_members[i]], "Miembro duplicado");

            members.push(_members[i]);
            isMember[_members[i]] = true;
        }
    }

    // ========== FUNCIONES PRINCIPALES ==========

    /**
     * @dev Depositar fondos en el vault
     */
    function deposit() external payable onlyMember {
        require(msg.value > 0, "Debe depositar un monto mayor a 0");
        emit DepositMade(msg.sender, msg.value);
    }

    /**
     * @dev Crear propuesta de retiro
     * @param _description Descripción del motivo del retiro
     * @param _recipient Dirección que recibirá los fondos
     * @param _amount Monto a retirar
     */
    function proposeWithdrawal(
        string memory _description,
        address payable _recipient,
        uint256 _amount
    ) external onlyMember returns (uint256) {
        require(_amount > 0, "El monto debe ser mayor a 0");
        require(
            _amount <= address(this).balance,
            "Fondos insuficientes en el vault"
        );
        require(_recipient != address(0), "Direccion de destinatario invalida");
        require(
            bytes(_description).length > 0,
            "La descripcion no puede estar vacia"
        );

        uint256 proposalId = proposalCounter++;
        Proposal storage newProposal = proposals[proposalId];

        newProposal.id = proposalId;
        newProposal.proposalType = ProposalType.WITHDRAWAL;
        newProposal.proposer = msg.sender;
        newProposal.description = _description;
        newProposal.recipient = _recipient;
        newProposal.amount = _amount;
        newProposal.status = ProposalStatus.PENDING;
        newProposal.createdAt = block.timestamp;

        emit ProposalCreated(proposalId, ProposalType.WITHDRAWAL, msg.sender);
        return proposalId;
    }

    /**
     * @dev Crear propuesta para agregar nuevo miembro
     * @param _description Descripción del motivo
     * @param _newMember Dirección del nuevo miembro
     */
    function proposeAddMember(
        string memory _description,
        address _newMember
    ) external onlyMember returns (uint256) {
        require(_newMember != address(0), "Direccion invalida");
        require(!isMember[_newMember], "Ya es miembro del vault");
        require(
            bytes(_description).length > 0,
            "La descripcion no puede estar vacia"
        );

        uint256 proposalId = proposalCounter++;
        Proposal storage newProposal = proposals[proposalId];

        newProposal.id = proposalId;
        newProposal.proposalType = ProposalType.ADD_MEMBER;
        newProposal.proposer = msg.sender;
        newProposal.description = _description;
        newProposal.newMember = _newMember;
        newProposal.status = ProposalStatus.PENDING;
        newProposal.createdAt = block.timestamp;

        emit ProposalCreated(proposalId, ProposalType.ADD_MEMBER, msg.sender);
        return proposalId;
    }

    /**
     * @dev Votar en una propuesta
     * @param _proposalId ID de la propuesta
     * @param _inFavor true para votar a favor, false para votar en contra
     */
    function vote(
        uint256 _proposalId,
        bool _inFavor
    ) external validProposal(_proposalId) onlyMember {
        Proposal storage proposal = proposals[_proposalId];
        require(
            !proposal.hasVoted[msg.sender],
            "Ya has votado en esta propuesta"
        );

        proposal.hasVoted[msg.sender] = true;

        if (_inFavor) {
            proposal.votesFor++;
        } else {
            proposal.votesAgainst++;
        }

        emit VoteCasted(_proposalId, msg.sender, _inFavor);

        // Verificar si se alcanzó el quorum
        _checkAndExecuteProposal(_proposalId);
    }

    /**
     * @dev Verificar y ejecutar propuesta si se alcanzó la mayoría simple
     * @param _proposalId ID de la propuesta
     */
    function _checkAndExecuteProposal(uint256 _proposalId) private {
        Proposal storage proposal = proposals[_proposalId];

        uint256 totalMembers = members.length;
        uint256 totalVotes = proposal.votesFor + proposal.votesAgainst;

        // Mayoría simple: más del 50% de votos a favor
        uint256 requiredVotes = (totalMembers / 2) + 1;

        if (proposal.votesFor >= requiredVotes) {
            // Ejecutar propuesta
            proposal.status = ProposalStatus.EXECUTED;

            if (proposal.proposalType == ProposalType.WITHDRAWAL) {
                _executeWithdrawal(_proposalId);
            } else if (proposal.proposalType == ProposalType.ADD_MEMBER) {
                _executeAddMember(_proposalId);
            }

            emit ProposalExecuted(_proposalId);
        } else if (
            totalVotes == totalMembers && proposal.votesFor < requiredVotes
        ) {
            // Todos votaron pero no se alcanzó la mayoría
            proposal.status = ProposalStatus.REJECTED;
            emit ProposalRejected(_proposalId);
        }
    }

    /**
     * @dev Ejecutar retiro de fondos
     * @param _proposalId ID de la propuesta
     */
    function _executeWithdrawal(uint256 _proposalId) private {
        Proposal storage proposal = proposals[_proposalId];

        require(
            address(this).balance >= proposal.amount,
            "Fondos insuficientes"
        );

        proposal.recipient.transfer(proposal.amount);

        emit WithdrawalExecuted(proposal.recipient, proposal.amount);
    }

    /**
     * @dev Ejecutar adición de nuevo miembro
     * @param _proposalId ID de la propuesta
     */
    function _executeAddMember(uint256 _proposalId) private {
        Proposal storage proposal = proposals[_proposalId];

        members.push(proposal.newMember);
        isMember[proposal.newMember] = true;

        emit MemberAdded(proposal.newMember);
    }

    // ========== FUNCIONES DE CONSULTA ==========

    /**
     * @dev Obtener información básica del vault
     */
    function getVaultInfo()
        external
        view
        returns (
            string memory _name,
            address[] memory _members,
            uint256 balance,
            uint256 _proposalCounter
        )
    {
        return (name, members, address(this).balance, proposalCounter);
    }

    /**
     * @dev Obtener información de una propuesta
     * @param _proposalId ID de la propuesta
     */
    function getProposalInfo(
        uint256 _proposalId
    )
        external
        view
        returns (
            uint256 id,
            ProposalType proposalType,
            address proposer,
            string memory description,
            address recipient,
            uint256 amount,
            address newMember,
            uint256 votesFor,
            uint256 votesAgainst,
            ProposalStatus status
        )
    {
        Proposal storage proposal = proposals[_proposalId];
        return (
            proposal.id,
            proposal.proposalType,
            proposal.proposer,
            proposal.description,
            proposal.recipient,
            proposal.amount,
            proposal.newMember,
            proposal.votesFor,
            proposal.votesAgainst,
            proposal.status
        );
    }

    /**
     * @dev Verificar si una dirección ya votó en una propuesta
     * @param _proposalId ID de la propuesta
     * @param _voter Dirección del votante
     */
    function hasVoted(
        uint256 _proposalId,
        address _voter
    ) external view returns (bool) {
        return proposals[_proposalId].hasVoted[_voter];
    }

    /**
     * @dev Obtener todos los miembros del vault
     */
    function getMembers() external view returns (address[] memory) {
        return members;
    }

    /**
     * @dev Obtener número total de miembros
     */
    function getMemberCount() external view returns (uint256) {
        return members.length;
    }

    /**
     * @dev Obtener balance del vault
     */
    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    // Función receive para aceptar transferencias directas de ETH
    receive() external payable {
        emit DepositMade(msg.sender, msg.value);
    }
}

