// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./MultiVault.sol";

/**
 * @title MultiVaultFactory
 * @dev Factory para crear y gestionar wallets comunitarias MultiVault
 * @notice Este contrato crea nuevas instancias de MultiVault y mantiene un registro de todas
 */
contract MultiVaultFactory {
    // ========== VARIABLES DE ESTADO ==========

    address[] public allVaults;
    mapping(address => address[]) public userVaults;
    mapping(address => bool) public isVault;

    // ========== EVENTOS ==========

    event VaultCreated(
        address indexed vaultAddress,
        string name,
        address[] members,
        address indexed creator,
        uint256 timestamp
    );

    // ========== FUNCIONES PRINCIPALES ==========

    /**
     * @dev Crear un nuevo vault comunitario
     * @param _name Nombre del vault
     * @param _members Array de direcciones de los miembros iniciales
     * @return vaultAddress Dirección del nuevo vault creado
     */
    function createVault(
        string memory _name,
        address[] memory _members
    ) external returns (address vaultAddress) {
        require(_members.length >= 2, "Se requieren al menos 2 miembros");
        require(bytes(_name).length > 0, "El nombre no puede estar vacio");

        // Verificar que el creador esté en la lista de miembros
        bool creatorIncluded = false;
        for (uint256 i = 0; i < _members.length; i++) {
            if (_members[i] == msg.sender) {
                creatorIncluded = true;
                break;
            }
        }
        require(
            creatorIncluded,
            "El creador debe estar en la lista de miembros"
        );

        // Crear nueva instancia de MultiVault
        MultiVault newVault = new MultiVault(_name, _members);
        vaultAddress = address(newVault);

        // Registrar el vault
        allVaults.push(vaultAddress);
        isVault[vaultAddress] = true;

        // Registrar el vault para cada miembro
        for (uint256 i = 0; i < _members.length; i++) {
            userVaults[_members[i]].push(vaultAddress);
        }

        emit VaultCreated(
            vaultAddress,
            _name,
            _members,
            msg.sender,
            block.timestamp
        );

        return vaultAddress;
    }

    // ========== FUNCIONES DE CONSULTA ==========

    /**
     * @dev Obtener todos los vaults creados
     * @return Array de direcciones de todos los vaults
     */
    function getAllVaults() external view returns (address[] memory) {
        return allVaults;
    }

    /**
     * @dev Obtener vaults de un usuario específico
     * @param _user Dirección del usuario
     * @return Array de direcciones de vaults donde el usuario es miembro
     */
    function getUserVaults(
        address _user
    ) external view returns (address[] memory) {
        return userVaults[_user];
    }

    /**
     * @dev Obtener el número total de vaults creados
     * @return Número total de vaults
     */
    function getTotalVaults() external view returns (uint256) {
        return allVaults.length;
    }

    /**
     * @dev Verificar si una dirección es un vault creado por esta factory
     * @param _vault Dirección a verificar
     * @return true si es un vault válido
     */
    function isValidVault(address _vault) external view returns (bool) {
        return isVault[_vault];
    }

    /**
     * @dev Obtener información de un vault específico
     * @param _vaultAddress Dirección del vault
     * @return name Nombre del vault
     * @return members Lista de miembros
     * @return balance Balance actual
     * @return proposalCounter Número de propuestas
     */
    function getVaultInfo(
        address _vaultAddress
    )
        external
        view
        returns (
            string memory name,
            address[] memory members,
            uint256 balance,
            uint256 proposalCounter
        )
    {
        require(isVault[_vaultAddress], "No es un vault valido");
        MultiVault vault = MultiVault(payable(_vaultAddress));
        return vault.getVaultInfo();
    }

    /**
     * @dev Obtener vaults creados en un rango específico
     * @param _start Índice inicial
     * @param _end Índice final (exclusivo)
     * @return Array de direcciones de vaults en el rango
     */
    function getVaultsByRange(
        uint256 _start,
        uint256 _end
    ) external view returns (address[] memory) {
        require(_start < _end, "Rango invalido");
        require(_end <= allVaults.length, "Fin fuera de rango");

        uint256 length = _end - _start;
        address[] memory vaultsInRange = new address[](length);

        for (uint256 i = 0; i < length; i++) {
            vaultsInRange[i] = allVaults[_start + i];
        }

        return vaultsInRange;
    }

    /**
     * @dev Obtener el número de vaults de un usuario
     * @param _user Dirección del usuario
     * @return Número de vaults donde el usuario es miembro
     */
    function getUserVaultCount(address _user) external view returns (uint256) {
        return userVaults[_user].length;
    }
}

